import React, { Component } from "react";
import "./App.css";
import User from "./Components/User";
class App extends Component {
  render() {
    return (
      <div className="app">
        <User name="张三" age={12} user={{name:"张三",}}/>
      </div>
    );
  }
}
export default App;
